    $('#console').append('> exec <br>');

    /** 
     *  adding the contents of https://raw.githubusercontent.com/Microsoft/TypeScript/master/lib/lib.d.ts 
     *  to remove compile errors related to browser API calls. This adds seconds to compile time.. would
     *  like to find a better way to do this, but for now it makes compiling work as expected.
     **/

    var source = editor.getValue();
